class Table extends Component {

    constructor(props) {
        super(props);

        this.state = {
            data: [],
        };
    }







    render() {
       /* if (this.state.loading) {
            return <div>loading...</div>;
        }

        if (!this.state.person) {
            return <div>didn't get a person</div>;
        }*/

        const {data}=this.state;
        console.log(data.length);
        console.log(data);

              return(
            <div className="table1">
            <table style={{width:"80%"}}>
            <thead>
                <tr>
                    <th>EMPLOYEE ID</th>
                    <th>EMPLOYYEE NAME</th>
                    <th>PROGRESS</th>
                </tr>
            </thead>
            <tbody>
            {
                data.map(row => (
                    <tr>
                        <td>{row.id}</td>
                        <td>{row.empname}</td>
                        <span><button><td >{row.mon}</td></button></span>
                    </tr>
                ))

            }

            </tbody>

            </table>
            </div>
        )
    }

}

export default Table;
